INSERT INTO `huertosl_ceiba`.`ventas` (`id_venta`, `id_usuario`, `id_cliente`, `id_lider`, `contrato_html`, `version`, `estado`, `testigo_1`, `testigo_2`, `precio`, `enganche`, `abono`, `porcentaje_comision`, `comision`, `porcentaje_penalizacion`, `retrasos_permitidos`, `created_at`, `updated_at`) VALUES (1, 9, 23, 22, '<h1>CONTRATO PRIVADO DE CESIÓN DE DERECHOS A PLAZOS</h1><p><strong>Contrato Privado de Cesión de Derechos a Plazos, que celebran en la Ciudad de Playa del Carmen</strong>, Municipio de Solidaridad, Estado de Quintana Roo, México, <strong id=\"fecha_init_1\" class=\"fecha_init\">el día miércoles, 15 de febrero del año 2017</strong>, de una parte a quien de ahora en adelante se llamará <strong>\"EL CEDENTE\"</strong>, de una parte el Señor <strong>FRANCISCO ENRIQUE MARTÍNEZ CORDERO</strong>, en su carácter de Propietario, y de la otra parte el C.: <strong>MARIA LUISA CRUZ MENDOZA</strong>, a quién en lo sucesivo se le designará<strong> \"EL CESIONARIO\"</strong>, y que junto con <strong>\"EL CEDENTE\"</strong> se denominarán <strong>\"LAS PARTES\"</strong>, por su Propio y Personal Derecho respecto a una Fracción del Predio Rustico, ubicado en el Municipio de Lázaro Cárdenas, Estado de Quintana Roo, México, de la posesión de la Primera de los nombrados, lo que verifican al tenor de las siguientes Declaraciones y Cláusulas:</p><h1>D E C L A R A C I O N E S</h1><p>El Señor<strong> FRANCISCO ENRIQUE MARTÍNEZ CORDERO</strong>, con la Personalidad antes indicada; bajo Formal Protesta de Decir Verdad, Declara:</p><ol type=\"I\"><li>Que es el propietario único y tiene la posesión en forma pública, pacífica y continua, y en Carácter de Propietario de la Fracción I perteneciente al Predio Rustico Denominado<strong> \"La Ceiba\"</strong>; ubicada en la localidad de Kantunilkin, Municipio de Lázaro Cárdenas, Estado de Quintana Roo, México, con las Colindancias Siguientes: <strong>al Noreste</strong>; en Seiscientos Cuarenta y Ocho Punto Cincuenta y Seis Metros con Ejido Playa del Carmen; <strong>al Sur</strong>; en Seiscientos Punto Cero Cero Metros con \"Bulevar la Ceiba\", <strong>al Sureste</strong>; en Setecientos Trece Punto Sesenta y tres Metros con Predio los Cedros; <strong>al Noroeste</strong>, en Ochocientos Diez y Seis Punto Cuarenta Metros con Predio Patricia; con una Superficie de Cincuenta y tres Hectáreas, 45 Centiáreas y 27.79 Áreas.</li><li>Que acredita la Posesión de la Fracción antes descrita y deslindada en la Declaración Primera, mediante Escritura Publica<strong> No. DOS CIENTOS CUARENTA Y NUEVE VOLUMEN TERCERO, TOMO \"A\"</strong>, celebrado ante Notario Público número treinta y tres a los 9 días del mes de diciembre del año 2004 debidamente registrada ante la Dirección General del Registro Público de la Propiedad y del Comercio Delegación Cancún del Estado de Quintana Roo con el folio número <strong>149971</strong>.</li><li>Que por así convenir a sus intereses, ha decidido subdividir en Fracciones convencionalmente el Predio Descrito y Deslindado en la Declaración Primera, siendo materia de este Contrato la fracción marcada convencionalmente con el Número 6, que a continuación se describe: <strong>LA MANZANA 6</strong>, del Predio Rustico denominado “La Ceiba” ubicado en la localidad de Kantunilkin, Municipio de Lázaro Cárdenas, Estado de Quintana Roo, México, con las Medidas y Colindancias Siguientes: <strong>Al Noreste</strong>, 125.000 MTS. CON MZ 7; <strong>Al Sureste</strong>, 70.000 MTS. CON SENDERO CEIBA; <strong>Al Suroeste</strong>, 125.000 MTS. CON MZ 5; <strong>Al Noroeste</strong>, 70.000 MTS. CON PREDIO PATRICIA; con una Superficie total de 8,750.00 M<sup>2</sup></li><li>El Señor<strong> FRANCISCO ENRIQUE MARTÍNEZ CORDERO</strong>; se obliga y compromete a realizar todos y cada uno de los trámites y gestiones necesarias ante la Dirección de Catastro y de Desarrollo Urbano, del Municipio de Lázaro Cárdenas; Estado de Quintana Roo, con el fin de obtener la Autorización de Subdivisión correspondiente a la Fracción I, de su Propiedad, descrito y deslindado en la Declaración Primera, resultando la Fracción marcada convencionalmente con el Número 6, en declaración III.</li><li>El Señor<strong> FRANCISCO ENRIQUE MARTÍNEZ CORDERO</strong>, en su Carácter de propietario, bajo formal Protesta de decir verdad, declara: que <strong>LA MANZANA 6</strong>, motivo de la Presente Operación, no ha sido Cedida, Vendida o Comprometida en forma con anterioridad a este Acto. Y es el motivo del presente contrato ceder de manera definitiva en co-propiedad<div>el<strong> huerto 9</strong> con una superficie de 312.50 M<sup>2</sup>, con las Medidas y Colindancias Siguientes: <strong>Al Noreste</strong>, 12.500 MTS. CON HUERTO 2A MZ 7; <strong>Al Sureste</strong>, 25.000 MTS. CON HUERTO 9A; <strong>Al Suroeste</strong>, 12.500 MTS. CON PALMA REAL; <strong>Al Noroeste</strong>, 25.000 MTS. CON HUERTO 8A;</div><div>el<strong> huerto 9A</strong> con una superficie de 312.50 M<sup>2</sup>, con las Medidas y Colindancias Siguientes: <strong>Al Noreste</strong>, 12.500 MTS. CON HUERTO 2 MZ 7; <strong>Al Sureste</strong>, 25.000 MTS. CON HUERTO 10; <strong>Al Suroeste</strong>, 12.500 MTS. CON PALMA REAL; <strong>Al Noroeste</strong>, 25.000 MTS. CON HUERTO 9;</div></li><li>Declara<strong> \"EL CESIONARIO\"</strong>, que conoce el estado físico y jurídico que guarda la Fracción, materia del Presente contrato y que está de acuerdo conforme con adquirirlo en co-propiedad.</li></ol><p>Expuestas las anteriores Declaraciones, se otorgan las siguientes:</p><h1>C L A U S U L A S</h1><p><strong>PRIMERA.- </strong>El Señor <strong>FRANCISCO ENRIQUE MARTÍNEZ CORDERO</strong>, en su Carácter antes indicado, Declara y Otorga: Que en uso de las facultades que tiene derecho: CEDE, de una manera definitiva, sin restricción y con la salvedad que más adelante aparece a <strong>\"EL CESIONARIO\"</strong>, los DERECHOS, que legítimamente tiene adquiridos y le corresponde, de <strong>LA MANZANA 6</strong> perteneciente a la Fracción I del Predio Rustico denominado <strong>\"La Ceiba\"</strong>, ubicada en la localidad de Kantunilkin, Municipio de Lázaro Cárdenas, Estado de Quintana Roo, México, descrita en la Declaración Quinta, la cual en lo conducente se tiene por reproducida en la presente Cláusula, como si se insertara a la letra, para todos los efectos legales; Predio que se encuentra Libre de Gravamen, y sin ningún Servicio Público, con todo cuanto de hecho y por derecho corresponde a dicho Inmueble, transfiriendo desde luego todos los DERECHOS que legítimamente tiene adquirido respecto a la citada Fracción de Terreno en co-propiedad.</p><p><strong>SEGUNDA.- </strong>El Precio Convenido Total y Único de la CESION DE DERECHOS Consignada en el presente Contrato, lo Constituye la Suma de $154,000.00 (<span id=\"precio_1\">CIENTO CINCUENTA Y CUATRO MIL PESOS 00/100 MN</span>), cantidad que <strong>\"EL CESIONARIO\"</strong>, cubrirá a <strong>\"EL CEDENTE\" </strong>de la siguiente manera:</p><p>Con un Enganche, por la Cantidad de $4,000.00 (<span id=\"enganche\">CUATRO MIL PESOS 00/100 MN</span>) cantidad que <strong>\"EL CEDENTE\"</strong>, confiesa recibir al momento de la firma del presente por parte de <strong>\"EL CESIONARIO\"</strong>, mediante transferencia electrónica de fondos en la cuenta y banco que para tal efecto <strong>\"EL CEDENTE\"</strong> indique en Billetes del Banco de México, de Curso legal, contados y revisados a su entera satisfacción y sin derecho a reclamación alguna posterior; sirviendo el mismo como el recibo más eficaz que en Derecho corresponda; Y el saldo, lo cubrirán<strong> \"EL CESIONARIO\"</strong> a <strong>\"EL CEDENTE\"</strong>, mediante 50 pagos mensuales y consecutivos por la cantidad de $3,000.00 (<span id=\"abono_1\">TRES MIL PESOS 00/100 MN</span>), cada día quince (15) de cada mes, debiendo efectuarse el Primer Pago <strong id=\"fecha_primer_pago\">el día miércoles, 15 de marzo del año 2017</strong> y un último <strong id=\"fecha_ultimo_pago\">el día jueves, 15 de abril del año 2021</strong> . En caso de que el día 15 del mes sea un día no hábil, el día de pago se recorrerá al siguiente día hábil, sin que esto se considere incumplimiento por parte de <strong>\"EL CESIONARIO\"</strong>, dicho pago se realizará a través de transferencia electrónica a la CLABE; 0446 9423 7005 2489 18 o en la cuenta 237 0052 4891 del banco SCOTIABANK a nombre de: FRANCISCO ENRIQUE MARTINEZ CORDERO.</p><p>LAS PARTES acuerdan enfocar su esquema al Pagare General que se adjunta al presente contrato como Anexo 1.</p><p><strong>TERCERA.- </strong>LAS PARTES hacen constar: Que el presente Contrato de Cesión de Derechos a Plazos, no es rescindible a causa o pretexto de lesión, en virtud de que el precio de la presente Operación fue fijado de común acuerdo por las propias partes.</p><p><strong>CUARTA.- </strong><strong>\"EL CEDENTE\"</strong>, Declara que se obliga y compromete a firmar a favor de <strong>\"EL CESIONARIO\"</strong>, de la Persona Física o Moral que este designe, la Escritura Definitiva de Traslación de Dominio, siempre y cuando la autoridad correspondiente haya otorgado la autorización de subdivisión y la Escritura Pública; de la Fracción Descrita y Deslindada en la Declaración Primera; esto siempre y cuando <strong>\"EL CESIONARIO\"</strong>, haya liquidado en su totalidad el precio establecido.</p><p><strong>QUINTA.- </strong><strong>\"EL CESIONARIO\"</strong>, se obligan y compromete a realizar todos y cada uno de los trámites y aportaciones necesarias ante las autoridades correspondientes, para la obtención de los Servicios de Urbanización (Luz, Agua, Drenaje, Pavimentación, etc.) que en su momento oportuno se debieran efectuar. (O adquirir con sus recursos propios, los servicios que necesite de manera alternativa; celdas solares, pozo de agua, con filtros, biodigestores certificados, pavimentación, etc.</p><p><strong>SEXTA.- </strong><strong>\"EL CESIONARIO\"</strong>, se obliga y compromete a realizar el pago de Mil Quinientos Pesos Anuales, al Ejido de Playa del Carmen, Municipio de Solidaridad, los cuales serán utilizados para el cuidado, mantenimiento y Vigilancia del acceso General, indirectamente incluyendo la Fracción Adquirida en el Presente Contrato. Dicho pago se realizará directamente en la Casa Ejidal de Playa del Carmen siguiendo los protocolos que para este fin, la autoridad Ejidal hubiese determinado.</p><p><strong>SEPTIMA.- </strong>Todos los gastos, impuestos derechos y honorarios relacionados con el otorgamiento del presente Contrato Privado de Cesión de Derechos a Plazos, serán cubiertos únicamente por<strong> \"EL CESIONARIO\"</strong>.</p><p><strong>OCTAVA.- </strong>De conformidad las partes acuerdan que los Gastos, Impuestos, Derechos y Honorarios, impuestos sobre la renta y el impuesto cedular derivados y/o causados por la formalización Notarial del Contrato Definitivo de Compra-Venta serán por cuenta de las partes en 2 porciones iguales del 50% del costo de cada uno de dichos conceptos.</p><p><strong>NOVENA.- </strong>Las partes convienen en celebrar este contrato por su propia y libre voluntad y manifiestan que no han sufrido coacción, violencia, error, dolo o engaño alguno.</p><p><strong>DECIMA.- </strong>Las partes reconocen que si durante la vigencia del presente contrato, llegara a fallecer el<strong> C. FRANCISCO ENRIQUE MARTINEZ CORDERO</strong>, éste declara como beneficiario y/o sustituto de sus derechos y obligaciones a la <strong>C. VICTORIA REGALADO PEREZ</strong>, quien se identifica y acredita en su carácter de esposa.</p><p><strong>DÉCIMA PRIMERA.- </strong><strong>\"EL CEDENTE\"</strong> y <strong>\"EL CESIONARIO\"</strong>, acuerdan que se entiende: entregado el predio físicamente desde el momento que se haya firmado el presente contrato privado de cesión de derechos. Asimismo a partir de la fecha de entrega de <strong>\"LA ESCRITURA PUBLICA DEFINITIVA EN CO-PROPIEDAD\"</strong> objeto del presente contrato, <strong>\"EL CESIONARIO\" </strong>se obligara a pagar el impuesto predial, y demás contribuciones correspondientes que se causen con motivo de la posesión o el uso del mismo.</p><p><strong>DÉCIMA SEGUNDA.- </strong>LAS PARTES declaran expresamente que el objeto de la futura compra - venta de <strong>LA MANZANA 6 </strong>es la de sub-dividir para obtener la escrituración individualizada por cuenta y costo de los co-propietarios, aceptando de manera voluntaria e incondicional firmar la subdivisión del predio que se adjudicó.</p><p><strong>DECIMA TERCERA.- </strong>Para todo lo relativo a la interpretación cumplimiento y ejecución del presente contrato, en caso de Juicio las partes se someten de manera expresa a la Jurisdicción y competencia del Juzgado Civil de Primera Instancia del Distrito Judicial de Lázaro Cárdenas Estado de Quintana Roo, México, renunciando a cualquier otro fuero que pudiera corresponderles, en razón de su domicilio o vecindad, presente o futura.</p><p><strong>DECIMA CUARTA.- </strong><strong>\"EL CESIONARIO\" </strong>declara que acepta la Cesión de Derechos a Plazos, que se otorga a su favor, en las Declaraciones, de acuerdo a los términos establecidos en las cláusulas anteriores.</p><p><strong>DECIMA QUINTA.- </strong><strong>\"EL CESIONARIO\" </strong>podrá traspasar su derecho a un tercero, podrá traspasar su derecho a un tercero, previa autorización de la parte <strong>\"CEDENTE\"</strong>.</p><h1>PENALIZACIONES</h1><p>Las partes han decidido estipular como penalización:</p><ol type=\"i\"><li>En caso de impuntualidad en los pagos mensuales se cargara el 1% del pago vencido por cada día hábil que se retrase, hasta cubrir el adeudo, considerando que, en caso de que el día de pago sea un día no hábil, el día de pago se recorrerá al siguiente día hábil;</li><li>en caso de no cubrir 3 pagos se da por rescindido el presente contrato de manera automática sin ningún requerimiento de aviso, ni tramite, renunciando de esta manera a cualquier reclamación presente o futura de pagos realizados, y/o mejoras realizadas en el terreno, por parte de<strong> \"EL CESIONARIO\"</strong>,</li></ol><h1>DATOS G E N E R A L E S</h1><p>Los Contratantes por sus generales bajo Formal Protesta de decir verdad declaran ser: el Señor<strong> FRANCISCO ENRIQUE MARTÍNEZ CORDERO</strong>, Casado, Arquitecto, Natural de Cozumel; Estado de Quintana Roo, donde nació el día Cinco de Mayo del año de Mil Novecientos Sesenta y Uno, y vecino de esta Localidad, con domicilio en Ave. Montes Azules esquina Solidaridad mz.16, lt.14, de la colonia Bosque Real en Playa del Carmen Quintana Roo y <strong>MARIA LUISA CRUZ MENDOZA nacido(a) en Citacuaro Michoacan el <span id=\"fecha_init_5\" class=\"fecha_init\">el día lunes, 01 de febrero del año 1954</span> y con domicilio en Calle: Avenida 140 Entre Calle 5 Y 7 Sur No. ext: Lt. 11 No. int: Mz. 64 Colonia: BellaVista Municipio: Solidaridad Estado: Quintana Roo Ciudad: Playa Del Carmen Codigo postal: 77712</strong></p><p>Y para constancia y seguridad de las partes, se firma el presente Contrato Privado de Cesión de Derechos, en la<strong>Ciudad de Playa del Carmen, Municipio de Solidaridad</strong>, Estado de Quintana Roo, México, <span id=\"fecha_init_2\" class=\"fecha_init\">el día miércoles, 15 de febrero del año 2017</span>.</p><table class=\"testigos\"><thead><tr><th>EL CEDENTE</th><th>EL CESIONARIO</th></tr></thead><tbody><tr><td><div><span class=\"underline\"> </span>FRANCISCO ENRIQUE MARTÍNEZ CORDERO</div></td><td><div><span class=\"underline\"> </span>MARIA LUISA CRUZ MENDOZA</div></td></tr></tbody><tfoot><tr><td><div><span class=\"underline\"> </span>VICTORIA REGALADO PEREZ</div></td><td><div><span class=\"underline\"> </span>VICTORIA REGALADO PEREZ</div></td></tr></tfoot></table><h1>ANEXO 1</h1><h1>PAGARE GENERAL</h1><p>El C. MARIA LUISA CRUZ MENDOZA (el Deudor) con generales establecidas en el contrato de fecha<span id=\"fecha_init_3\" class=\"fecha_init\">el día miércoles, 15 de febrero del año 2017</span>del cual forma parte integral el presente anexo y el C. FRANCISCO ENRIQUE MARTÍNEZ CORDERO (el Acreedor), con generales establecidas en las declaraciones del presente contrato, a través de este documento, un \"PAGARE GENERAL\" que establece lo siguiente:</p><p>Primero: El deudor acepta y se compromete a pagar la deuda contraída con el acreedor, la cual asciende a la cantidad de $154,000.00 (<span id=\"precio_2\">CIENTO CINCUENTA Y CUATRO MIL PESOS 00/100 MN</span>).</p><p>Segundo: De mutuo acuerdo se establece el siguientes fechas de vencimiento:</p><p>El deudor pagará mensualmente $3,000.00 (<span id=\"abono_2\">TRES MIL PESOS 00/100 MN</span>) en un plazo no mayor a 50 meses a partir del inicio de este plan de pagos a la cuenta definida por el acreedor:</p><div>SCOTIABANK SUCURSAL 005</div><div>A NOMBRE DE FRANCISCO ENRIQUE MARTINEZ CORDERO</div><div>NUMERO DE CUENTA 237 0052 4891</div><div>CLABE INTERBANCARIA 0446 9423 7005 2489 18</div><p>EL deudor podrá, si así lo considera necesario, adelantar pagos con la intención de reducir su plazo de pago, o en su defecto, el monto mensual a pagar. Para tal efecto, El deudor y el Acreedor se pondrán de acuerdo sobre la modificación correspondiente en el presente anexo del contrato.</p><p>APLICACIÓN DE VENCIMIENTO ANTICIPADO: “El Deudor/Suscriptor” reconoce y acepta que a la falta de pago oportuno de 3 o más amortizaciones que conforme a este pagaré deba realizar, generará el vencimiento anticipado de los demás pagos sucesivos que falten por vencer y por lo tanto se da por rescindido el contrato objeto de la presente obligación, de manera automática sin ningún requerimiento de aviso, ni tramite, renunciando de esta manera a cualquier reclamación presente o futura de pagos realizados, y/o mejoras realizadas en el terreno, por parte del Cesionario.</p><p>CARGOS POR MORA.- En caso de que cualquier cantidad pagadera al Acreedor bajo este plan de pagos no sea pagada a su vencimiento, el Saldo Insoluto del presente Pagaré vencerá anticipadamente en ese momento y sin necesidad de aviso o requerimiento previo, el Suscriptor pagara a la vista del Acreedor, una pena por mora de 1% (<span id=\"porcentaje\">UN </span>por ciento por cada día hábil) hasta que se reciba el pago.</p><p>JURISDICCION Y LEY APLICABLE: Para la interpretación, ejecución, cumplimiento de este pagaré y en su caso para el requerimiento judicial del pago de su importe serán competentes los tribunales de la ciudad de Lázaro Cárdenas, Estado de Quintana Roo, México, renunciando expresamente a cualquier otro fuero que por razón de sus domicilios presentes o futuros pudieran corresponderles.</p><p>El presente plan de pagos se establece <span id=\"fecha_init_4\" class=\"fecha_init\">el día miércoles, 15 de febrero del año 2017</span> en la ciudad de Cancún.</p><table class=\"pagares-tabla\"><thead><tr><th>Concepto</th><th>Monto a pagar</th><th>Fecha de pago</th><th>Concepto</th><th>Monto a pagar</th><th>Fecha de pago</th></tr></thead><tbody><tr><td>ENGANCHE</td><td>$ 4,000.00</td><td>15-02-2017</td><td>PAGO 1</td><td>$ 3,000.00</td><td>15-03-2017</td></tr><tr><td>PAGO 2</td><td>$ 3,000.00</td><td>15-04-2017</td><td>PAGO 3</td><td>$ 3,000.00</td><td>15-05-2017</td></tr><tr><td>PAGO 4</td><td>$ 3,000.00</td><td>15-06-2017</td><td>PAGO 5</td><td>$ 3,000.00</td><td>15-07-2017</td></tr><tr><td>PAGO 6</td><td>$ 3,000.00</td><td>15-08-2017</td><td>PAGO 7</td><td>$ 3,000.00</td><td>15-09-2017</td></tr><tr><td>PAGO 8</td><td>$ 3,000.00</td><td>15-10-2017</td><td>PAGO 9</td><td>$ 3,000.00</td><td>15-11-2017</td></tr><tr><td>PAGO 10</td><td>$ 3,000.00</td><td>15-12-2017</td><td>PAGO 11</td><td>$ 3,000.00</td><td>15-01-2018</td></tr><tr><td>PAGO 12</td><td>$ 3,000.00</td><td>15-02-2018</td><td>PAGO 13</td><td>$ 3,000.00</td><td>15-03-2018</td></tr><tr><td>PAGO 14</td><td>$ 3,000.00</td><td>15-04-2018</td><td>PAGO 15</td><td>$ 3,000.00</td><td>15-05-2018</td></tr><tr><td>PAGO 16</td><td>$ 3,000.00</td><td>15-06-201